function App() {
  return (
    <div className="App">
      <BrowserRouter>

      <Sidebar />
      <Switch>
      <Route path="/home" component= { Home } />
      <Route path="/dog/:id" component={<dogDetail/>} />
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
